338	Project	45	45	description	\N	\N	\N	\N	\N	\N	\N	\N	\N	<p>Холдинг БЛ ГРУПП (BOOS LIGHTING GROUP) — крупнейшее российское объединение на светотехническом рынке, располагающее всеми необходимыми исследовательскими, инженерными и производственными ресурсами. Компания профессионально выполняет работы любого уровня сложности по проектированию, производству, поставке оборудования, монтажу и технической поддержке световых систем в период их эксплуатации.&nbsp;</p>\n<p><br></p>\n<p>Со стороны Simbirsoft проводится разработка мобильного приложения на IOS для IPad и IPad-MINI, которое позволяет выполнять светотехнические расчеты на планшетах. &nbsp;</p>\n<p>Ссылка на приложение в appstore: <a href="https://itunes.apple.com/us/app/light-in-night/id1303625947?mt=8" title="https://itunes.apple.com/us/app/light-in-night/id1303625947?mt=8" target="_black">https://itunes.apple.com/us/app/light-in-night/id1303625947?mt=8</a>&nbsp;</p>\n<p>Так же планируется разработка идентичного приложения на Android соответственно.&nbsp;</p>\n<p><br></p>\n<p>Полезная информация:</p>\n<p><br></p>\n<p>1) Доступ к аккаунту в Apple Store:</p>\n<p><a href="https://itunesconnect.apple.com/WebObjects/iTunesConnect.woa" title="https://itunesconnect.apple.com/WebObjects/iTunesConnect.woa" target="_top">https://itunesconnect.apple.com/WebObjects/iTunesConnect.woa</a></p>\n<p>support@bl-g.ru</p>\n<p>416510Xk41vu2</p>\n<p><br></p>\n<p>2) iPad для тестирования:</p>\n<p>Apple ID: riazantsev@inbox.ru</p>\n<p>Серийный номер устройства: DMPN90JQF19M</p>\n<p>UDID: d9914c9cc752cd39631bb7f2a157f7594969caf6</p>\n<p><br></p>\n<p>3) Исходный код десктопного приложения (для служебного пользования) можно скачать по ссылке <a href="https://cloud.mail.ru/public/JpAd/2DFQ8bgKH" title="https://cloud.mail.ru/public/JpAd/2DFQ8bgKH" target="_top">https://cloud.mail.ru/public/JpAd/2DFQ8bgKH</a></p>\n<p><br></p>\n<p>4) Код расчетного модуля для мобильного приложения с описанием:</p>\n<p><a href="https://cloud.mail.ru/public/9qDv/onc9bLw6e" title="https://cloud.mail.ru/public/9qDv/onc9bLw6e" target="_top">https://cloud.mail.ru/public/9qDv/onc9bLw6e</a></p>\n<p><br></p>\n<p>5) Антуражные объекты, которые планируется реализовать в новой десктопной версии:</p>\n<p><a href="https://cloud.mail.ru/public/79yq/1L3mySUD7" title="https://cloud.mail.ru/public/79yq/1L3mySUD7" target="_top">https://cloud.mail.ru/public/79yq/1L3mySUD7</a></p>\n<p><br></p>\n<p>6) Вопросы к заказчику и ответы на них</p>\n<p><a href="https://docs.google.com/document/d/1rNL-QPCxCn7pWcRLs2HXA1Ay_bKe0eXrzO9nuhr9ZXg/edit?usp=sharing" title="https://docs.google.com/document/d/1rNL-QPCxCn7pWcRLs2HXA1Ay_bKe0eXrzO9nuhr9ZXg/edit?usp=sharing" target="_top">https://docs.google.com/document/d/1rNL-QPCxCn7pWcRLs2HXA1Ay_bKe0eXrzO9nuhr9ZXg/edit?usp=sharing</a></p>\n<p><br></p>\n<p>7) Получение файла со светильниками</p>\n<p>При запуске приложения запрашивают файл, передавая тип приложения</p>\n<p>Пример (для LiNMobile),</p>\n<p><a href="http://www.l-i-n.ru/webservice/api.php?method=gc_database.info&amp;app=linmobile" title="http://www.l-i-n.ru/webservice/api.php?method=gc_database.info&amp;amp;app=linmobile" target="_top">http://www.l-i-n.ru/webservice/api.php?method=gc_database.info&amp;app=linmobile</a></p>\n<p>Инструкция по замене БД светильников для тестирования: <a href="https://docs.google.com/document/d/180YgFe2LglYEq-_OQvfkYSqBQdzhHyKdBnMdYN9XwFk/edit?usp=sharing" title="https://docs.google.com/document/d/180YgFe2LglYEq-_OQvfkYSqBQdzhHyKdBnMdYN9XwFk/edit?usp=sharing" target="_top">https://docs.google.com/document/d/180YgFe2LglYEq-_OQvfkYSqBQdzhHyKdBnMdYN9XwFk/edit?usp=sharing</a></p>\n<p><br></p>\n<p>8) Аккаунт в testfairy ss.tf@yandex.ru / SSM2002</p>\n<p>в ответ получаем xml:</p>\n<p>&lt;response_ws&gt;</p>\n<p>&lt;date&gt;1608291519&lt;/date&gt;</p>\n<p>&lt;size&gt;30048753&lt;/size&gt;</p>\n<p>&lt;data_file&gt;<a href="http://l-i-n.ru/files/galad_catalog.zip%3C/data_file" title="http://l-i-n.ru/files/galad_catalog.zip&amp;lt;