571	Project	65	65	description	\N	\N	\N	\N	\N	\N	\N	\N		<p>Личный кабинет &nbsp;партнера "Совести". Заведение анкет на получение карты "Совесть".<br>\n<br>\nБраузеры:</p>\n<ul>\n  <li>- Google Chrome 61 и выше;</li>\n  <li>- Yandex Browser 17;</li>\n  <li>- Mozilla Firefox 52 и выше;</li>\n  <li>- Safari 9 и выше.</li>\n</ul>\n<p>Ниже требования к информационной безопасности:&nbsp;</p>\n<p>&nbsp;</p>\n<p>OWASP Top-10</p>\n<p>&nbsp;<a href="https://www.owasp.org/index.php/OWASP_Cheat_Sheet_Series#tab=Master_Cheat_Sheet" title="https://www.owasp.org/index.php/OWASP_Cheat_Sheet_Series#tab=Master_Cheat_Sheet">https://www.owasp.org/index.php/OWASP_Cheat_Sheet_Series#tab=Master_Cheat_Sheet</a></p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - валидация пользовательского ввода</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; * защита от&nbsp;SQL injection&nbsp;(prepared Statements)</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; *&nbsp;RCE&nbsp;(unserialize)</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; *&nbsp;Code Injection&nbsp;(exec,&nbsp;process...)</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; *&nbsp;XXE&nbsp;(отключение парсинга&nbsp;Doctype)</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - экранирование выходных параметров</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;* защита от&nbsp;XSS&nbsp;</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- защита от&nbsp;CSRF</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; * токены в теле/заголовках запросов</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - проверка прав пользователей</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;* доступ в приложение</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; * доступ&nbsp; к файлам и папкам сервера</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - валидация загружаемых файлов</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; * проверка расширения файла</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; * проверка&nbsp;content-type&nbsp;файла</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; * в случае изоражений - проверка на валидность изображения (getimagesize)</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - отсутствие чувствительных данных</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; * файлы конфигурации (.htaccess, .ini, .db)</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; * файлы индексов репозиториев (.git, .svn)</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; * адресов, учеток, паролей в исходных кодах</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - защита от подмены параметров (parameter tampering)</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; * проверка соответствия выполняемого действия и&nbsp;id&nbsp;пользователя</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - защита от фиксации сесии</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; * смена сессиионного токена после входа в приложение, смены пароля&nbsp;</p>	update	2017-12-28 06:50:03.503+00	205
572	Project	65	65	description	\N	\N	\N	\N	\N	\N	\N	\N	<p>Личный кабинет &nbsp;партнера "Совести". Заведение анкет на получение карты "Совесть".<br>\n<br>\nБраузеры:</p>\n<ul>\n  <li>- Google Chrome 61 и выше;</li>\n  <li>- Yandex Browser 17;</li>\n  <li>- Mozilla Firefox 52 и выше;</li>\n  <li>- Safari 9 и выше.</li>\n</ul>\n<p>Ниже требования к информационной безопасности:&nbsp;</p>\n<p>&nbsp;</p>\n<p>OWASP Top-10</p>\n<p>&nbsp;<a href="https://www.owasp.org/index.php/OWASP_Cheat_Sheet_Series#tab=Master_Cheat_Sheet" title="https://www.owasp.org/index.php/OWASP_Cheat_Sheet_Series#tab=Master_Cheat_Sheet">https://www.owasp.org/index.php/OWASP_Cheat_Sheet_Series#tab=Master_Cheat_Sheet</a></p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - валидация пользовательского ввода</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; * защита от&nbsp;SQL injection&nbsp;(prepared Statements)</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; *&nbsp;RCE&nbsp;(unserialize)</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; *&nbsp;Code Injection&nbsp;(exec,&nbsp;process...)</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; *&nbsp;XXE&nbsp;(отключение парсинга&nbsp;Doctype)</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - экранирование выходных параметров</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;* защита от&nbsp;XSS&nbsp;</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- защита от&nbsp;CSRF</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; * токены в теле/заголовках запросов</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - проверка прав пользователей</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;* доступ в приложение</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; * доступ&nbsp; к файлам и папкам сервера</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - валидация загружаемых файлов</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; * проверка расширения файла</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; * проверка&nbsp;content-type&nbsp;файла</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; * в случае изоражений - проверка на валидность изображения (getimagesize)</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - отсутствие чувствительных данных</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; * файлы конфигурации (.htaccess, .ini, .db)</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; * файлы индексов репозиториев (.git, .svn)</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; * адресов, учеток, паролей в исходных кодах</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - защита от подмены параметров (parameter tampering)</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; * проверка соответствия выполняемого действия и&nbsp;id&nbsp;пользователя</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - защита от фиксации сесии</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; * смена сессиионного токена после входа в приложение, смены пароля&nbsp;</p>	<p>Личный кабинет &nbsp;партнера "Совести". Заведение анкет на получение карты "Совесть".<br>\n&nbsp;</p>\n<p>Браузеры:</p>\n<ul>\n  <li>Google Chrome 61 и выше;</li>\n  <li>Yandex Browser 17;</li>\n  <li>Mozilla Firefox 52 и выше;</li>\n  <li>Safari 9 и выше.</li>\n</ul>\n<p>Ниже требования к информационной безопасности:&nbsp;</p>\n<p>OWASP Top-10</p>\n<p><a href="https://www.owasp.org/index.php/OWASP_Cheat_Sheet_Series#tab=Master_Cheat_Sheet" title="https://www.owasp.org/index.php/OWASP_Cheat_Sheet_Series#tab=Master_Cheat_Sheet">https://www.owasp.org/index.php/OWASP_Cheat_Sheet_Series#tab=Master_Cheat_Sheet</a></p>\n<ol>\n  <li>Валидация пользовательского ввода<