730	Project	65	65	description	\N	\N	\N	\N	\N	\N	\N	\N	<p>Личный кабинет &nbsp;партнера "Совести". Заведение анкет на получение карты "Совесть".<br>\n &nbsp;&nbsp;&nbsp;ТЗ: https://docs.google.com/document/d/1M97VEhioBfbuzDkDgrnmDhQdU-e37DSNPfhMKge3DZk/edit<br>\n &nbsp;&nbsp;&nbsp;UserStory: https://docs.google.com/spreadsheets/d/15xVgFvrgQ-zTEpPYEJSBmGTcoB1s58VvibfL3YHBTVg/edit#gid=375643927<br>\n &nbsp;&nbsp;&nbsp;Roadmap: https://docs.google.com/spreadsheets/d/1REeIm_h8SwJC3jAVgwLn7ziv7s0bg0UYDqM5jH00tYM/edit?usp=sharing<br>\n&nbsp;</p>\n<p>Браузеры:</p>\n<p><br></p>\n<ul>\n  <li>Google Chrome 61 и выше;</li>\n  <li>Yandex Browser 17;</li>\n  <li>Mozilla Firefox 52 и выше;</li>\n  <li>Safari 9 и выше.<br>\n <br>\n &nbsp;&nbsp;Разрешения:</li>\n  <li>1920&nbsp;</li>\n  <li>1440&nbsp;</li>\n  <li>1024</li>\n  <li>780&nbsp;</li>\n  <li>320</li>\n</ul>\n<p>Ниже требования к информационной безопасности:&nbsp;</p>\n<p>OWASP Top-10</p>\n<p><a href="https://www.owasp.org/index.php/OWASP_Cheat_Sheet_Series#tab=Master_Cheat_Sheet" title="https://www.owasp.org/index.php/OWASP_Cheat_Sheet_Series#tab=Master_Cheat_Sheet">https://www.owasp.org/index.php/OWASP_Cheat_Sheet_Series#tab=Master_Cheat_Sheet</a></p>\n<p><br></p>\n<ol>\n  <li>Валидация пользовательского ввода</li>\n</ol>\n<p><br></p>\n<ul>\n  <li>защита от SQL injection (prepared Statements)</li>\n  <li>RCE (unserialize)</li>\n  <li>Code Injection (exec, process...)</li>\n  <li>XXE (отключение парсинга Doctype)</li>\n</ul>\n<p><br></p>\n<ol>\n  <li>экранирование выходных параметров</li>\n</ol>\n<p><br></p>\n<ul>\n  <li>защита от XSS&nbsp;</li>\n</ul>\n<p><br></p>\n<ol>\n  <li>защита от CSRF</li>\n</ol>\n<p><br></p>\n<ul>\n  <li>токены в теле/заголовках запросов</li>\n</ul>\n<p><br></p>\n<ol>\n  <li>проверка прав пользователей</li>\n</ol>\n<p><br></p>\n<ul>\n  <li>доступ в приложение</li>\n  <li>доступ &nbsp;к файлам и папкам сервера</li>\n</ul>\n<p><br></p>\n<ol>\n  <li>валидация загружаемых файлов</li>\n</ol>\n<p><br></p>\n<ul>\n  <li>проверка расширения файла</li>\n  <li>проверка content-type файла</li>\n  <li>в случае изоражений - проверка на валидность изображения (getimagesize)</li>\n</ul>\n<p><br></p>\n<ol>\n  <li>отсутствие чувствительных данных</li>\n</ol>\n<p><br></p>\n<ul>\n  <li>файлы конфигурации (.htaccess, .ini, .db)</li>\n  <li>файлы индексов репозиториев (.git, .svn)</li>\n  <li>адресов, учеток, паролей в исходных кодах</li>\n</ul>\n<p><br></p>\n<ol>\n  <li>защита от подмены параметров (parameter tampering)</li>\n</ol>\n<p><br></p>\n<ul>\n  <li>проверка соответствия выполняемого действия и id пользователя</li>\n</ul>\n<p><br></p>\n<ol>\n  <li>защита от фиксации сесии</li>\n</ol>\n<p><br></p>\n<ul>\n  <li>смена сессиионного токена после входа в приложение, смены пароля&nbsp;</li>\n</ul>\n<p>Дизайн:<br>\n&nbsp;</p>\n<p>https://app.zeplin.io/project/5a61ed4ec172986710e5d235/dashboard<br>\n &nbsp;Логин: uziwemmasse-8435@yopmail.com<br>\n &nbsp;Пароль: req_1234</p>\n<p>Гитлаб:<br>\n http://gitlab.simbirsoft/frontend/sovest-agent-lk<br>\n&nbsp;</p>	<p>Личный кабинет &nbsp;партнера "Совести". Заведение анкет на получение карты "Совесть".<br>\n &nbsp;&nbsp;&nbsp;&nbsp;ТЗ: https://docs.google.com/document/d/1M97VEhioBfbuzDkDgrnmDhQdU-e37DSNPfhMKge3DZk/edit<br>\n &nbsp;&nbsp;&nbsp;&nbsp;UserStory: https://docs.google.com/spreadsheets/d/15xVgFvrgQ-zTEpPYEJSBmGTcoB1s58VvibfL3YHBTVg/edit#gid=375643927<br>\n &nbsp;&nbsp;&nbsp;&nbsp;Roadmap: https://docs.google.com/spreadsheets/d/1REeIm_h8SwJC3jAVgwLn7ziv7s0bg0UYDqM5jH00tYM/edit?usp=sharing<br>\n<br>\n&nbsp;</p>\n<p>Браузеры:</p>\n<p><br></p>\n<ul>\n  <li>Google Chrome 61 и выше;</li>\n  <li>Yandex Browser 17;</li>\n  <li>Mozilla Firefox 52 и выше;</li>\n  <li>Safari 9 и выше.<br>\n <br>\n &nbsp;&nbsp;&nbsp;Разрешения:</li>\n  <li>1920&nbsp;</li>\n  <li>1440&nbsp;</li>\n  <li>1024</li>\n  <li>780&nbsp;</li>\n  <li>320</li>\n</ul>\n<p>Ниже требования к информационной безопасности:&nbsp;</p>\n<p>OWASP Top-10</p>\n<p><a href="https:/