10732	Task	907	907	description	\N	\N	\N	\N	\N	\N	\N	\N	update	2018-01-19 08:09:09.659+00	102	<p>Необходимо реализовать привязку спринта к ТШ&nbsp;</p>\n<p>В база данных это поле уже имеется.</p>\n<ul>\n  <li>в Случае если время в ТШ списано на непроектную активность(прочая активность без привязки к projectID), то спринт должен быть null</li>\n  <li>если ТШ в проекте (есть projectID), то ТШ всегда со значением sprintID, в том числе и для magic activity.\n    <ul>\n      <li>если время по задаче, то ТШ списывается на тот спринт, в котором в данный момент находится задача</li>\n      <li>если время по magic activity, то время сприсывается на активный спринт, который сейчас в процессе.\n        <ul>\n          <li>если в процессе 2 спринта, то берется тот, который подходит по датам</li>\n          <li>если подходят по датам оба, то первый.</li>\n        </ul>\n      </li>\n    </ul>\n  </li>\n</ul>\n<p>Также в запросе предусмотреть возможность отправки sprintID с UI - это потребуется для ввода времени для magic activity</p>\n<p><br></p>	<p><br></p>
