11563	Task	581	581	description	\N	\N	\N	\N	\N	\N	\N	\N	update	2018-01-25 13:13:52.764+00	163	<p>Текущая версия не очень удобна в работе. &nbsp;Обсуждаем с отделом продаж, как улучшить отображение свободных сотрудников. &nbsp;От отдела продаж участвует Евгений Васильев. &nbsp;</p>\n<p>Обсуждение ведём в гугл-доке: &nbsp;https://docs.google.com/document/d/1mzPvVcVR16t4xNg-JDvGvMvxEl2CEs072C... &nbsp;&nbsp;&nbsp;&nbsp;</p>\n<p><br></p>\n<p>Со стороны PS доработан REST /auth/timesheets/info.&nbsp;</p>\n<p><br></p>\n<p>Там возвращаются два доп. поля: &nbsp;</p>\n<p>{... &nbsp;&nbsp;</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;"vacationHours" : 12, &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;"sickLeaveHours" : 8,&nbsp;</p>\n<p>...</p>\n<p>} &nbsp;</p>\n<p>vacationHours - часы, потраченные на отпуск.&nbsp;</p>\n<p>sickLeaveHours - часы, потраченные на больничный.</p>\n<p><br></p>\n<p>Бывшая задача в ПС: https://ps.simbirsoft.com/default/DiscussionRedirect.svc?sp=S104936</p>\n<p><br></p>\n<p>мерж-реквест: http://gitlab.simbirsoft/java/maketalents/merge_requests/2134</p>	<p>Текущая версия не очень удобна в работе. &nbsp;Обсуждаем с отделом продаж, как улучшить отображение свободных сотрудников. &nbsp;От отдела продаж участвует Евгений Васильев. &nbsp;</p>\n<p>Обсуждение ведём в гугл-доке: &nbsp;https://docs.google.com/document/d/1mzPvVcVR16t4xNg-JDvGvMvxEl2CEs072C... &nbsp;&nbsp;&nbsp;&nbsp;</p>\n<p>Со стороны PS будет доработан REST /auth/timesheets/info. Там будут возвращаться ещё два поля: &nbsp;{... &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;"vacationHours" : 12, &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;"sickLeaveHours" : 8, ...} &nbsp;vacationHours - часы, потраченные на отпуск. sickLeaveHours - часы, потраченные на больничный.</p>
