11733	Task	979	979	description	\N	\N	\N	\N	\N	\N	\N	\N	update	2018-01-26 13:21:45.506+00	1986	<p>В разделе "Планирование" необходимо добавить маску ввода для поля "Дата" в окнах создания и редактирования вехи</p>\n<p>1. Формат даты оставить прежним - ДД.ММ.ГГГГ (аналогично отображению дат в других разделах)</p>\n<p>2. Допускается только ввод цифр</p>\n<p>3. Ввод букв и других символов, кроме цифр, игнорируется</p>\n<p>4. Точки, необходимые для соответствия формату ДД.ММ.ГГГГ, проставляются автоматически</p>\n<p>5. При выборе даты в календаре она автоматически отображается в формате ДД.ММ.ГГГГ&nbsp;</p>\n<p>Примечание: см. также связанную задачу ST-978</p>	<p>В разделе "Планирование" необходимо добавить маску ввода для поля "Дата" в окнах создания и редактирования вехи</p>\n<p>1. Формат даты оставить прежним - ДД.ММ.ГГГГ (аналогично отображению дат в других разделах)</p>\n<p>2. Допускается только ввод цифр</p>\n<p>3. Ввод букв и других символов, кроме цифр, игнорируется</p>\n<p>4. Точки, необходимые для соответствия формату ДД.ММ.ГГГГ, проставляются автоматически</p>\n<p>5. При выборе даты в календаре она автоматически отображается в формате ДД.ММ.ГГГГ&nbsp;</p>\n<p>Примечание: см. также связанную задачу&nbsp;</p>
