6692	Task	553	553	description	\N	\N	\N	\N	\N	\N	\N	\N	update	2017-12-19 05:26:09.916+00	1838	<p>Google Chrome Версия 62.0.3202.94 (Официальная сборка), (64 бит) &nbsp;</p>\n<p>https://smartstaff-public-bugs.simbirsoft1.com &nbsp;</p>\n<p>На форме создания нового профиля соискателя есть возможность указать несколько социальных сетей - добавляя поле "Социальная сеть" для указания новой соц.сети в отдельном поле.&nbsp;</p>\n<p>Поля можно как добавить, как и убрать по соответствующей кнопке рядом с полем. &nbsp;</p>\n<p>Шаги: &nbsp;</p>\n<p>1. Открыть страницу "Найм" - "Соискатели";&nbsp;</p>\n<p>2. На странице "Соискатели" нажать кнопку "Создать новый профиль";&nbsp;</p>\n<p>3. В блоке "Контактные данные" ввести значение в поле "Социальная сеть"; &nbsp;</p>\n<p>4. Нажать знак "+" рядом с полем.&nbsp;</p>\n<p>5. Стереть введенные данные из первого поля. Нажать знак "-" рядом с первым полем.&nbsp;</p>\n<p>Фактический результат: &nbsp;Верстка поля ломается, поле не удаляется (если при нажатии на "-" оно пустое). &nbsp;</p>\n<p>Ожидаемый результат: &nbsp;Поле удаляется по кнопке "-".</p>\n<p>Ссылка на задачу в ps: https://ps.simbirsoft.com/default/DiscussionRedirect.svc?sp=S106629</p>	<p>Google Chrome Версия 62.0.3202.94 (Официальная сборка), (64 бит) &nbsp;https://smartstaff-public-bugs.simbirsoft1.com &nbsp;На форме создания нового профиля соискателя есть возможность указать несколько социальных сетей - добавляя поле "Социальная сеть" для указания новой соц.сети в отдельном поле. Поля можно как добавить, как и убрать по соответствующей кнопке рядом с полем. &nbsp;Шаги: &nbsp;Открыть страницу "Найм" - "Соискатели"; На странице "Соискатели" нажать кнопку "Создать новый профиль"; В блоке "Контактные данные" ввести значение в поле "Социальная сеть"; &nbsp;Нажать знак "+" рядом с полем. Стереть введенные данные из первого поля. Нажать знак "-" рядом с первым полем. Фактический результат: &nbsp;Верстка поля ломается, поле не удаляется (если при нажатии на "-" оно пустое). &nbsp;Ожидаемый результат: &nbsp;Поле удаляется по кнопке "-".</p>\n<p>Ссылка на задачу в ps: https://ps.simbirsoft.com/default/DiscussionRedirect.svc?sp=S106629</p>
