6954	Task	581	581	description	\N	\N	\N	\N	\N	\N	\N	\N	update	2017-12-20 11:42:23.847+00	96	<p>Текущая версия не очень удобна в работе. &nbsp;Обсуждаем с отделом продаж, как улучшить отображение свободных сотрудников. &nbsp;От отдела продаж участвует Евгений Васильев. &nbsp;</p>\n<p>Обсуждение ведём в гугл-доке: &nbsp;https://docs.google.com/document/d/1mzPvVcVR16t4xNg-JDvGvMvxEl2CEs072C... &nbsp;&nbsp;&nbsp;&nbsp;</p>\n<p>Со стороны PS будет доработан REST /auth/timesheets/info. Там будут возвращаться ещё два поля: &nbsp;{... &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;"vacationHours" : 12, &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;"sickLeaveHours" : 8, ...} &nbsp;vacationHours - часы, потраченные на отпуск. sickLeaveHours - часы, потраченные на больничный.</p>	Текущая версия не очень удобна в работе.\n\nОбсуждаем с отделом продаж, как улучшить отображение свободных сотрудников.\n\nОт отдела продаж участвует Евгений Васильев.\n\nОбсуждение ведём в гугл-доке:\n\nhttps://docs.google.com/document/d/1mzPvVcVR16t4xNg-JDvGvMvxEl2CEs072C...\n\n \n\nСо стороны PS будет доработан REST /auth/timesheets/info. Там будут возвращаться ещё два поля:\n\n{...   \n   "vacationHours" : 12,   \n   "sickLeaveHours" : 8,\n...}\n\nvacationHours - часы, потраченные на отпуск.\nsickLeaveHours - часы, потраченные на больничный.
