12505	Task	1077	1077	description	\N	\N	\N	\N	\N	\N	\N	\N	update	2018-02-02 08:08:46.864+00	1986	<p>Шаги:</p>\n<p>1. Открыть раздел "Отчеты по времени"</p>\n<p>2. Нажать "Добавить активность"</p>\n<p>3. Выбрать тип активности "Совещание"&nbsp;</p>\n<p>4. Указать проект</p>\n<p>5. Нажать "Добавить"</p>\n<p>Фактический результат: после добавления активности невозможно поменять проект</p>\n<p>Предложение:&nbsp;</p>\n<p>1. Для ТШ в статусе реджектед и до сабмита добавить возможность редактирования привязки к проекту для активностей:</p>\n<p>- Совещание</p>\n<p>- Преселлинг и оценка&nbsp;</p>\n<p>- Обучение&nbsp;</p>\n<p>- Командировка&nbsp;</p>\n<p>- Управление&nbsp;</p>\n<p>2. Для неперечисленных выше активностей (Implementation, Отпуск. Больничный) редактирование проекта оставить не доступным.</p>\n<p>3. Для ТШ в статусах апрувед и сабмит редактирование проекта оставить не доступным.&nbsp;</p>\n<p>4. При редактировании перечень проектов, которые можно указать, также должен включать вариант "Без проекта"</p>	<p>Шаги:</p>\n<p>1. Открыть раздел "Отчеты по времени"</p>\n<p>2. Нажать "Добавить активность"</p>\n<p>3. Выбрать тип активности "Совещание"&nbsp;</p>\n<p>4. Указать проект</p>\n<p>5. Нажать "Добавить"</p>\n<p>Фактический результат: после добавления активности невозможно поменять проект</p>\n<p><br></p>\n<p>Предложение:&nbsp;</p>\n<p>1. Для ТШ в статусе реджектед и до сабмита добавить возможность редактирования привязки к проекту для активностей:</p>\n<p>- Совещание</p>\n<p>- Преселлинг и оценка&nbsp;</p>\n<p>- Обучение&nbsp;</p>\n<p>- Командировка&nbsp;</p>\n<p>- Управление&nbsp;</p>\n<p>2. Для неперечисленных выше активностей (Implementation, Отпуск. Больничный) редактирование проекта оставить не доступным.</p>\n<p>3. Для ТШ в статусах апрувед и сабмит редактирование проекта оставить не доступным.&nbsp;</p>\n<p>4. При редактировании перечень проектов, которые можно указать, также должен включать вариант "Без проекта"</p>
