12510	Task	1082	1082	description	\N	\N	\N	\N	\N	\N	\N	\N	update	2018-02-02 09:10:59.176+00	287	<p>Каждые полчаса токен протухает. Нужно при получении кода ошибки 401 обновить токен и сделать заново запрос.</p>\n<p>В случае ошибки придет объект с примерной структурой {</p>\n<p>error: {</p>\n<p>&nbsp;&nbsp;type: 'tokenExpiredException'</p>\n<p>&nbsp;}</p>\n<p>}</p>\n<p>При логине мы получаем объект {</p>\n<p>&nbsp;&nbsp;userId: number;</p>\n<p>&nbsp;&nbsp;token: string;</p>\n<p>&nbsp;&nbsp;refreshToken: string;</p>\n<p><br></p>\n<p>}</p>\n<p>Чтобы обновить токен нужно послать PUT на /tokens с телом {</p>\n<p>&nbsp;&nbsp;refreshToken: refreshToken,</p>\n<p>&nbsp;&nbsp;DISALLOW_INTERCEPT: true</p>\n<p>}</p>\n<p>Чтобы не ждать полчаса, чтобы проверить работу интерспетора, можно написать unit-test</p>	<p>Каждые полчаса токен протухает. Нужно при получении кода ошибки 401 обновить токен и сделать заново запрос.</p>\n<p>В случае ошибки придет объект с примерной структурой {</p>\n<p>&nbsp;error: {</p>\n<p>&nbsp;&nbsp;&nbsp;type: 'tokenExpiredException'</p>\n<p>&nbsp;&nbsp;}</p>\n<p>}</p>\n<p>Чтобы не ждать полчаса, чтобы проверить работу интерспетора, можно написать unit-test</p>\n<p><br></p>
