12594	Task	1094	1094	description	\N	\N	\N	\N	\N	\N	\N	\N	update	2018-02-03 17:05:18.705+00	171	<p>Разработать сервис для работы со списками сущностей.</p>\n<p>Конструктор сервиса принимает в качестве зависимостей ссылку на один из http-сервисов, метод для отправки запроса ( по умолчанию getList ), и конфиг содержащий параметры запроса: длина списка, инициализирующая страница запроса. <br>\n&nbsp;</p>\n<p>Логика работы сервиса:<br>\n Сервис отправляет инициализирующий запрос - 1 страница, 10 записей. По успешному выполнению запроса - внутри сервиса выставляется хранимое значение следующей запрашиваемой страницы ( в данном случае 2 )</p>\n<p><br></p>\n<p>При каждой очередной загрузке элементов списка - сервис дополняет внутренний список элементов очередной загруженной порцией записей.&nbsp;</p>\n<p><br></p>\n<p>Данный список могут использовать любые компоненты для отображения в UI</p>	<p>Разработать сервис для работы со списками сущностей.</p>\n<p>Конструктор сервиса принимает в качестве зависимостей ссылку на один из http-сервисов, метод для отправки запроса ( по умолчанию getList ), и конфиг содержащий параметры запроса: длина списка, инициализирующая страница запроса. <br>\n<br>\nЛогика работы сервиса:<br>\nСервис отправляет инициализирующий запрос - 1 страница, 10 записей. По успешному выполнению запроса - внутри сервиса выставляется хранимое значение следующей запрашиваемой страницы ( в данном случае 2 )</p>
