1013	Интеграция модуля тестирования MT с RateApp	1	5	<p>https://docs.google.com/document/d/1DBPO_aBXrtzhhJ9D4hIhYAAyB-3hnEhdnDmS9lzPXao/edit</p>\n<p><br></p>\n<p>Задача в ps: https://ps.simbirsoft.com/default/DiscussionRedirect.svc?sp=S95101</p>\n<p><br></p>\n<p>Комментарии из ps:</p>\n<p><strong>Что сделано</strong></p>\n<p><a href="http://gitlab.simbirsoft/java/maketalents/tree/PS-95101-RateApp-integration" title="http://gitlab.simbirsoft/java/maketalents/tree/PS-95101-RateApp-integr...">http://gitlab.simbirsoft/java/maketalents/tree/PS-95101-RateApp-integr...</a></p>\n<p>1. Создание Шаблона тестов</p>\n<ul>\n  <li>Есть возможность выбора типа теста (Обычный, Проверка компетенций) - в классе Test добавлено поле&nbsp;public enum TestType. Добавлен новый класс Competence и таблица в БД.</li>\n  <li>Для теста "Проверка компетенций" необходимо выбирать Область знаний. В классе Test добавлено поле&nbsp;private Knowledge knowledge. Добавлен новый класс Knowledge и таблица в БД.</li>\n  <li>Класс TestQuestionBacking доработан: создаются новые группы вопросов в соответствии с Компетенциями и Областями знаний (теми, которые привязаны к выбранному шаблону теста). См. методы&nbsp;TestQuestionBacking.init(),&nbsp;TestQuestionBacking.getCompetences(). Возможно, понадобится их доработать с учетом api RateApp</li>\n</ul>\n<p>2. Для тестов "Проверка компетенций" нельзя редактировать группы вопросов. См. файл /pages/test/edit.xhtml</p>\n<p>3. Для групп вопросов можно задать количество вопросов и процент прохождения группы. В класс QuestionGroup добавлены поля&nbsp;questionsCount,&nbsp;passingPercentage.</p>\n<p>Вопросы выбираются случайно в классе AnswerResultsCalculator (методы&nbsp;createEmptyAnswerResults() и&nbsp;randomizeQuestions())</p>\n<p>4. Подсчет пройденных групп вопросов происходит в классе&nbsp;AnswerResultCalculator в методах autoAnswerResultVerifing() и getQuestionGroupResults()</p>\n<p>&nbsp;</p>\n<p>Файл миграции для этого функционала делался вручную /resources/db/changelog-20170904_141900-schema.xml</p>\n<p><strong>Что осталось</strong></p>\n<p>5. Действия при удалении/изменении/создании записей в RateApp</p>\n<p>Нужно сделать некий планировщик. Предполагалось, что RateApp будет присылать уведомления при изменении своих данных с помощью вебхуков.</p>\n<p>Сваггер rateApp&nbsp;skills.simbirsoft/api</p>\n<p>На 23.10.17 сам апи работает, сваггер - нет.</p>\n<p>&nbsp;</p>\n<p>Ветка от прошлого разработчика по этой задаче&nbsp;<a href="http://gitlab.simbirsoft/java/maketalents/tree/PS-95101-integration-with-RateApp" title="http://gitlab.simbirsoft/java/maketalents/tree/PS-95101-integration-wi...">http://gitlab.simbirsoft/java/maketalents/tree/PS-95101-integration-wi...</a> . Из нее можно подсмотреть исходник для планировщика.&nbsp;</p>\n<p><br></p>\n<p><a href="http://gitlab.simbirsoft/java/maketalents/merge_requests/2119" title="http://gitlab.simbirsoft/java/maketalents/merge_requests/2119">http://gitlab.simbirsoft/java/maketalents/merge_requests/2119</a>&nbsp;</p>	0.00	0.00	\N	1	1838	2018-01-30 08:17:47.641+00	2018-01-30 08:18:05.16+00	\N	\N	53	\N	163
