1021	Кэширование аватарок	1	1	<p>Аватарки меняются очень редко и должны кешироваться сервером&nbsp;</p>\n<p><br></p>\n<p>Задача в ps: https://ps.simbirsoft.com/default/DiscussionRedirect.svc?sp=S88768</p>\n<p><br></p>\n<p>Комментарии к задаче из ps:</p>\n<p>аватарки грузятся с smartstaff* , поэтому режимом кеширования аватарок, их expired и обновлением должен рулить smartstaff. Картинки получаются в обход SPA средствами браузера.</p>\n<p>Прошу перевести задачу на бек.&nbsp;</p>\n<p><br></p>\n<p>Проблема решается настройкой кэша в прокси:</p>\n<p>конфиг для nginx^</p>\n<p>proxy_cache_path /var/cache/nginx levels=1:2 keys_zone=my_cache:10m max_size=10g inactive=60m;</p>\n<p>location ~* ^.+\\.(?:css|cur|js|jpg|jpeg|gif|ico|png|otf|ttf|eot|woff|svg)$ {<br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; access_log off;<br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; expires 30d;<br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ## No need to bleed constant updates. Send the all shebang in one<br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ## fell swoop.<br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; tcp_nodelay off;<br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ## Set the OS file cache.<br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; open_file_cache max=3000 inactive=120s;<br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; open_file_cache_valid 45s;<br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; open_file_cache_min_uses 2;<br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; open_file_cache_errors off;<br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; }</p>\n<p>&nbsp;</p>\n<p>Для прода прокси&nbsp; уже давно есть, надо попросить админов добавить кеш в конфиг&nbsp;</p>	0.00	0.00	\N	3	1838	2018-01-30 08:49:30.394+00	2018-01-30 08:49:30.394+00	\N	\N	53	\N	163
