1027	Хлебные крошки. Приведение к единому виду.	1	1	<p><strong>На текущий момент логика в Заголовках такова:</strong></p>\n<ul>\n  <li>Если открыт раздел подменю, то перед названием окна Стоит знак &lt;</li>\n</ul>\n<p>(Например: &lt; Соискатели)</p>\n<ul>\n  <li>Если открыт раздел меню, то знака &lt; не должно быть.</li>\n</ul>\n<p><strong>Но не все заголовки сформированы таким образом</strong></p>\n<p><strong>Перечень отличающихся заголовков:</strong></p>\n<ul>\n  <li>Сотрудники/сотрудники - нет "&lt;"</li>\n  <li>Сотрудники/испытательный - срок&nbsp; нет "&lt;"</li>\n  <li>Сотрудники/свободные люди - нет "&lt;"</li>\n  <li>Обучение/монитор обучения - в заголовке указан раздел сотрудники</li>\n  <li>Курсы - "&lt;" не нужен</li>\n  <li>Мероприятия - "&lt;" не нужен</li>\n  <li>Видео - "&lt;" не нужен</li>\n  <li>Версии приложения - "&lt;" не нужен</li>\n  <li>Администрирование/Управление сервисами - отсутствует заголовок</li>\n</ul>\n<p><strong>Также предлагаю во всех заголовках окон указывать полный путь меню&gt;подменю (или меню&gt;подменю&gt;подменю соотвественно) по аналогии с разделом Сотрудники&gt;навыки</strong>&nbsp;</p>\n<p><br></p>\n<p>Задача в ps: https://ps.simbirsoft.com/default/DiscussionRedirect.svc?sp=S73906</p>\n<p><br></p>\n<p>Комментарий из ps:&nbsp;</p>\n<p>Переработали правило отображения хлебных крошек.</p>\n<p>1) Если у раздела есть родительские разделы, то они отображаются в хлебных крошках, например, " &gt; Сотрудники &gt; Навыки" (приложил скриншот).</p>\n<p>2) Если у раздела нет родительских разделов, то в хлебных крошках просто пишется название раздела, например, "Монитор" (приложил скриншот)</p>\n<p>&nbsp;</p>\n<p>Необходимо исправить разделы:</p>\n<p>Сотрудники &gt; Монитор настроений</p>\n<p>Сотрудники &gt; Качества</p>\n<p>Найм &gt; Соискатели</p>\n<p>Найм &gt; Вакансии</p>\n<p>Найм &gt; Тестовые задания</p>\n<p>Обучение &gt; Монитор обучения (сейчас тут ошибка 500, поэтому проверить не могу)</p>\n<p>Обучение &gt; Виды обучения</p>\n