1034	Поправить верстку писем от МТ	1	1	<p>За основу взять шаблон письма приложения meetapp</p>\n<p>Особого дизайна не надо, просто сделать аккуратный шаблон&nbsp;</p>\n<p><br></p>\n<p>Задача в ps: https://ps.simbirsoft.com/default/DiscussionRedirect.svc?sp=S96993</p>\n<p><br></p>\n<p>Комментарии в ps:</p>\n<p>1. Логин в письме находится посередине</p>\n<p>2. Обращение к пользователю не изменено на новый</p>\n<p>3. Иконки отзывов наезжают на текст&nbsp;</p>\n<p><br></p>\n<p>Исправления внесены, обновлено в ветке&nbsp;feature/email-layout&nbsp;</p>\n<p><br></p>\n<p>вмержено в девелоп&nbsp;</p>\n<p><br></p>\n<p>вылито на багс&nbsp;</p>\n<p><br></p>\n<p><strong>1. Ответственному за стажировку при создании испытательного срока</strong></p>\n<p>ФР:&nbsp;<a href="https://mail.google.com/mail/u/1/#inbox/15fe05bfd0245f69" title="https://mail.google.com/mail/u/1/#inbox/15fe05bfd0245f69">https://mail.google.com/mail/u/1/#inbox/15fe05bfd0245f69</a></p>\n<p>ОР: тело письма</p>\n<p>Добрый день, ...</p>\n<p>Вы назначены наставником ...., сотрудника отдела Финансов.</p>\n<p>Ссылка на профиль в МТ &lt;ссылка&gt;</p>\n<p>Дата начала испытательного срока: число месяц год.</p>\n<p>Дата окончания испытательного срока: число месяц год</p>\n<p>Ваши задачи:</p>\n<p>1. заполнение задач в MakeTalents;</p>\n<p>2. контроль проставления статуса;&nbsp;</p>\n<p>3. отзыв по результатам стажировки.</p>\n<p><strong>2. За 7 дн до окончания испыт срока стажеру</strong></p>\n<p>ФР: нет списка вопросов <a href="https://mail.google.com/mail/u/1/#inbox/15fe0679951dfdf9" title="https://mail.google.com/mail/u/1/#inbox/15fe0679951dfdf9">https://mail.google.com/mail/u/1/#inbox/15fe0679951dfdf9</a></p>\n<p>ОР: тело письма</p>\n<p>..... сентября у Вас заканчивается испытательный срок. В ближайшее время у вас состоится беседа с руководителем,<br>\nпо результатам прохождения стажировки.<br>\nДля подготовки к встрече, просим вас подумать над следующими вопросами:<br>\n- что Вам удалось изучить нового за период стажировки?<br>\n- какие вещи Вы стал делать лучше/эффективнее?<br>\n- Что на ваш взгляд, у вас получается хорошо, а что плохо?<br>\n- Какие Ваши дальнейшие планы по развитию в компании?<br>\n- Какие Ваши дальнейшие планы по развитию в компании?</p>\n<p><strong>3.&nbsp;За 7 дн до окончания испыт срока руководителю подразделения</strong></p>\n<p>ФР:&nbsp;нет ссылки на профиль, тело письма не соответсвт <a href="https://mail.google.com/mail/u/1/#inbox/15fe0675a9457510" title="https://mail.google.com/mail/u/1/#inbox/15fe0675a9457510">https://mail.google.com/mail/u/1/#inbox/15fe0675a9457510</a></p>\n<p>ОР: тело письма</p>\n<p>Добрый день, &lt;имя руководителя&gt;.<br>\nНапоминаем, у сотрудника вашего подразделения -&lt;сотрудник&gt; число месяц год года заканчивается испытательный срок.<br>\nВ срок до число месяц год &nbsp;года вам необходимо подготовить предварительную оценку стажера.<br>\nТак же, уведомляем вас, что за 7 дней до окончания испытательного срока сотруднику, для подготовки к встрече будут отправлены следующие вопросы:<br>\n- что вам удалось изучить нового за период стажировки?<br>\n- какие вещи вы стал делать лучше/эффективнее?<br>\n- Что на ваш взгляд, у вас получается хорошо, а что плохо?<br>\n- Какие ваши дальнейшие планы по развитию в компании?<br>\n- Как вы считаете, справились ли вы со стажировкой и почему?<br>\nПо окончанию испытательного срока с сотрудником вам необходимо провести беседу совместно с менеджером по персоналу.<br>\nВ ходе беседы нужно озвучить сотруднику результат прохождения испытательного срока- положительный или отрицательный.<br>\nТакже по итогам беседы необходимо будет выставить оценку по критериям:<br>\n<br>\nКритерий<br>\nПлохо (2)<br>\nУдовлетворительно (3)<br>\nХорошо (4)<br>\nОтлично (5)<br>\nЗнания и навыки по технологии <br>\nРезультативность (Успешность прохождения блока обучения) <br>\nВзаимоотношения с коллегами <br>\nЛояльность к компании <br>\nРезультаты оценки:<br>\n19-20 - высокий результат<br>\n16-18 – средний результат<br>\nДо 15 – низкий результат</p>\n<p><strong>4.&nbsp;Запланрированные отпуска руководителю отдела</strong></p>\n<p>ФР: старый шаблон <a href="https://mail.google.com/mail/u/0/#inbox/15fdaec85deb84a2" title="https://mail.google.com/mail/u/0/#inbox/15fdaec85deb84a2">https://mail.google.com/mail/u/0/#inbox/15fdaec85deb84a2</a></p>\n<p>5. Рассылка нового расписания о мероприятии</p>\n<p>ФР: нет информации&nbsp;<a href="https://mail.google.com/mail/u/1/#inbox/15fe04cb096b6895" title="https://mail.google.com/mail/u/1/#inbox/15fe04cb096b6895">https://mail.google.com/mail/u/1/#inbox/15fe04cb096b6895</a>&nbsp;</p>\n<p><br></p>\n<p>По итогам: обновлённая вёрстка не включается в релиз 0.21, пока оставляем прежнюю.&nbsp;</p>	0.00	0.00	\N	1	1838	2018-01-30 10:30:31.854+00	2018-01-31 07:46:00.423+00	\N	\N	53	\N	183
