1040	Bug: Просмотр стажировки - нет истории изменений	2	3	<p>1. Открыть страницу просмотра стажировки</p>\n<p>Фактический результат: история изменений не открываестя, логирования нет&nbsp;</p>\n<p><br></p>\n<p>Задача в ps: https://ps.simbirsoft.com/default/DiscussionRedirect.svc?sp=S51790</p>\n<p><br></p>\n<p>Комментарии в ps:&nbsp;</p>\n<p>В ходе анализа проблемы было выявлено, что данный функционал не реализован и данных с REST сервиса не приходит. Создана задача для REST API</p>\n<p><a href="https://ps.simbirsoft.com/default/project/DiscussionIssueView.epage?sp=Uo2k187g0000l12jmb26g000000&amp;sp=Uo2k187g0000l7o2b05mg000000#o2k187g0000l7o2b05mg000000" title="https://ps.simbirsoft.com/default/project/DiscussionIssueView.epage?sp=...">https://ps.simbirsoft.com/default/project/DiscussionIssueView.epage?sp=...</a>&nbsp;</p>\n<p><br></p>\n<p>Задача выполнена. Готова к тестированию&nbsp;</p>\n<p><br></p>\n<p>История изменений лишена информативности<br>\nОтсутствуют имена, названия и прочие данные.<br>\n(если удалена задача то кем удалена и название задачи и прочая информация в таком стиле)<br>\nчтобы было проще ориентироваться<br>\nкаждое такое поле можно начинать с новой строчки, потом двоеточие и данные (Имя, Назнавание, Дата, Комментарий и тд и тп)&nbsp;&nbsp;</p>\n<p><br></p>\n<p>На данный момент изменения вылиты на прод в недоработанном виде. Необходимо исправить:</p>\n<p>1. Название для decripsion,startDate&nbsp;<a href="http://joxi.ru/52a5Gzwh4kBoE2" title="http://joxi.ru/52a5Gzwh4kBoE2">http://joxi.ru/52a5Gzwh4kBoE2</a></p>\n<p>2. Нет русской локали для даты&nbsp;</p>\n<p>3. Описание выводится с тегами&nbsp;<a href="http://joxi.ru/VrwVK8kfO4bEeA" title="http://joxi.ru/VrwVK8kfO4bEeA">http://joxi.ru/VrwVK8kfO4bEeA</a></p>\n<p>4. При удалении комментария при нажатии на иконку для просмотра ничего не происходит&nbsp;<a href="http://joxi.ru/8Anx4oKhjyXJNm" title="http://joxi.ru/8Anx4oKhjyXJNm">http://joxi.ru/8Anx4oKhjyXJNm</a></p>\n<p>5. При добавлении задач к испытательному сроку в историю пишет "Испытательный срок создан пользователем", хотя есть уже лог о том, что создана задача&nbsp;<a href="http://joxi.ru/nAynaxyIYwVKBr" title="http://joxi.ru/nAynaxyIYwVKBr">http://joxi.ru/nAynaxyIYwVKBr</a></p>\n<p>6. При добавлении/изменении задачи нет русской локали для дат, статуса, отображаются тэги из описания&nbsp;<a href="http://joxi.ru/nAynaxyIYwVKBr" title="http://joxi.ru/nAynaxyIYwVKBr">http://joxi.ru/nAynaxyIYwVKBr</a>&nbsp;</p>\n<p><br></p>\n<p>1 пункт исправлен</p>\n<p>2 сделан таск для бэка</p>\n<p>3 исправлен</p>\n<p>4 не сделан</p>\n<p>5 сделан таск для бэка</p>\n<p>6 сделано&nbsp;&nbsp;</p>\n<p><br></p>\n<p>Заморожен, ждем добавление нужных полей и исправления с серверной стороны.&nbsp;</p>\n<p><br></p>\n<p>изменения с бэка сделаны( по крайней мере открытых задач по ресту нет)&nbsp;</p>	0.00	0.00	\N	3	1838	2018-01-30 11:02:50.852+00	2018-01-31 07:48:02.878+00	\N	\N	53	\N	183
